export default function savingWindow(){
      async function saveBeat() {
    const res = await fetch(`${process.env.REACT_APP_SERVER_URL}/archive`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        soundChoices: props.updatedSoundChoices,
        padsData: props.updatedPadsData,
      }),
    });
    const data = await res.json();
    if (!res.ok) {
      console.error("Error saving beat: " + data.message);
      return;
    }
    alert(data.message);
  }
    return(
        <div className="savingWindow">
            <form onSubmit={saveBeat}>
                <input></input>
                <button type="submit"></button>
            </form>
        </div>
    )
}
